
    <!DOCTYPE html>
    <html>
    <head>
        <title>Logistics Analysis Dashboard</title>
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <style>
            body {
                font-family: 'Arial', sans-serif;
                margin: 0;
                padding: 20px;
                background: linear-gradient(135deg, #F3E8FF 0%, #FAF5FF 100%);
                min-height: 100vh;
            }
            .dashboard-header {
                text-align: center;
                margin-bottom: 20px;
                padding: 15px;
                background: #7C3AED;
                border-radius: 10px;
                color: white;
                box-shadow: 0 6px 20px rgba(107, 70, 193, 0.2);
            }
            .dashboard-title {
                font-size: 36px;
                font-weight: bold;
                margin: 0;
            }
            .dashboard-container {
                max-width: 1800px;
                margin: 0 auto;
            }
            .card {
                background: rgba(255, 255, 255, 0.95);
                border-radius: 15px;
                box-shadow: 0 8px 32px rgba(107, 70, 193, 0.15);
                padding: 20px;
                margin: 8px;
                transition: all 0.3s ease;
                border: 1px solid rgba(107, 70, 193, 0.1);
            }
            .card:hover {
                transform: translateY(-5px);
                box-shadow: 0 12px 48px rgba(107, 70, 193, 0.25);
            }
            .kpi-card {
                text-align: center;
                position: relative;
            }
            .delta-indicator {
                position: absolute;
                top: 10px;
                right: 15px;
                padding: 4px 8px;
                border-radius: 12px;
                font-size: 12px;
                font-weight: bold;
                color: white;
            }
            .positive { background: #10B981; }
            .negative { background: #EF4444; }
            .dashboard-grid {
                display: grid;
                grid-template-columns: repeat(5, 1fr);
                grid-template-rows: auto auto auto;
                gap: 15px;
                max-width: 1800px;
                margin: 0 auto;
            }
            .row-1 { grid-row: 1; }
            .row-2 { grid-row: 2; }
            .row-3 { grid-row: 3; }
            .col-1 { grid-column: 1; }
            .col-2 { grid-column: 2; }
            .col-3 { grid-column: 3; }
            .col-4 { grid-column: 4; }
            .col-5 { grid-column: 5; }
            .col-1-2 { grid-column: 1/3; }
            .col-3-5 { grid-column: 3/6; }
            
            /* Responsive Design */
            @media screen and (max-width: 1200px) {
                .dashboard-grid {
                    grid-template-columns: repeat(3, 1fr);
                    grid-template-rows: auto auto auto auto;
                }
                .col-1 { grid-column: 1; }
                .col-2 { grid-column: 2; }
                .col-3 { grid-column: 3; }
                .col-4 { grid-column: 1; grid-row: 2; }
                .col-5 { grid-column: 2; grid-row: 2; }
                .col-1-2 { grid-column: 3; grid-row: 1/3; }
                .col-3-5 { grid-column: 1/4; grid-row: 3; }
                .row-3.col-1-2 { grid-column: 1/3; grid-row: 4; }
                .row-3.col-3-5 { grid-column: 3; grid-row: 4; }
            }
            
            @media screen and (max-width: 900px) {
                body {
                    padding: 15px;
                }
                .dashboard-title {
                    font-size: 28px;
                }
                .dashboard-grid {
                    grid-template-columns: repeat(2, 1fr);
                    grid-template-rows: auto auto auto auto auto auto;
                    gap: 12px;
                }
                .col-1 { grid-column: 1; grid-row: 1; }
                .col-2 { grid-column: 2; grid-row: 1; }
                .col-3 { grid-column: 1; grid-row: 2; }
                .col-4 { grid-column: 2; grid-row: 2; }
                .col-5 { grid-column: 1; grid-row: 3; }
                .col-1-2 { grid-column: 2; grid-row: 3/5; }
                .col-3-5 { grid-column: 1/3; grid-row: 5; }
                .row-3.col-1-2 { grid-column: 1/3; grid-row: 6; }
                .row-3.col-3-5 { grid-column: 1/3; grid-row: 7; }
                .card {
                    padding: 15px;
                    margin: 4px;
                }
            }
            
            @media screen and (max-width: 600px) {
                body {
                    padding: 10px;
                }
                .dashboard-title {
                    font-size: 24px;
                }
                .dashboard-header {
                    padding: 12px;
                }
                .dashboard-grid {
                    grid-template-columns: 1fr;
                    grid-template-rows: repeat(8, auto);
                    gap: 10px;
                }
                .col-1, .col-2, .col-3, .col-4, .col-5, 
                .col-1-2, .col-3-5, .row-3.col-1-2, .row-3.col-3-5 {
                    grid-column: 1;
                }
                .col-1 { grid-row: 1; }
                .col-2 { grid-row: 2; }
                .col-3 { grid-row: 3; }
                .col-4 { grid-row: 4; }
                .col-5 { grid-row: 5; }
                .col-1-2 { grid-row: 6; }
                .col-3-5 { grid-row: 7; }
                .row-3.col-1-2 { grid-row: 8; }
                .row-3.col-3-5 { grid-row: 9; }
                .card {
                    padding: 12px;
                    margin: 2px;
                }
                .delta-indicator {
                    font-size: 10px;
                    padding: 3px 6px;
                }
            }
            
            @media screen and (max-width: 400px) {
                body {
                    padding: 8px;
                }
                .dashboard-title {
                    font-size: 20px;
                }
                .dashboard-header {
                    padding: 10px;
                }
                .card {
                    padding: 10px;
                    margin: 1px;
                }
            }
            
            /* Make Plotly charts responsive */
            .plotly-graph-div {
                width: 100% !important;
                height: auto !important;
            }
        </style>
        <script>
            // Make Plotly charts responsive
            window.addEventListener('resize', function() {
                var plots = document.querySelectorAll('.plotly-graph-div');
                for (var i = 0; i < plots.length; i++) {
                    Plotly.Plots.resize(plots[i]);
                }
            });
        </script>
    </head>
